import React from 'react';

import {
    Animated
} from "react-animated-css";

import PopUpCompany from "../PopUpCompany";


class CardCompany extends React.Component {
    render() {
        return (
            <div className="col-12 col-md-6 col-lg-4 padding-top-bottom-companies">
                <PopUpCompany
                    {...this.props}
                    company={this.props.name}
                />
            </div>
        );
    }
}

class CardCompanyMobile extends React.Component {
    render() {
        return (
            <div className="col-12 col-md-6 col-lg-4 padding-top-bottom-companies margin-top-20">
                <PopUpCompany
                    {...this.props}
                    company={this.props.name}
                />
            </div>
        );
    }
}

export {
    CardCompany as default,
    CardCompanyMobile
};
